import React, { Component } from 'react'
import Typography from '@material-ui/core/Typography'

interface Idata{
    title?: string,
    teacher?: string,
    deadline ?: string,
    scienceArea?: string,
    description?: string,
    reportFile?: string,
    presentationFile?: string,
    consultantReportFile?: string,
    link?: string,
    teacherContacts?: string,
    consultant?: string,
    consultantContacts?: string,
    critic?: string,
    status?: string,
    id?: number
}

interface Props{
    data: {}[]
}

interface State{

}

class RequestsList extends Component<Props,State>{
    constructor(props : Props){
        super(props);
        this.state={}
    }

    private renderRequestsList(){
        this.props.data.map( (item:Idata) => {
            return(
            <div>
                <Typography >{item.title}, {item.teacher}</Typography>

            </div>
            )
        })
    }

    render(){
        return this.renderRequestsList();
    }
}

export default RequestsList
